import React from 'react';
import 'bootstrap';
import 'jquery';

import { Dashboard } from './Components/Dashboard/Dashboard';
import { Navigation } from './Components/Navigation';

function App() {
  return (
    <div className="row">

      <div className="col-4">
        <Navigation/>
      </div>

      <div className="col-8">
        <Dashboard />
      </div>

    </div>
  );
}

export default App;
